// NewProfileForm.jsx

import React from "react";
import { Dialog, DialogTitle, DialogContent, DialogActions, Button, TextField } from "@mui/material";

function NewProfileForm({ open, handleClose }) {
  return (
    <Dialog open={open} onClose={handleClose}>
      <DialogTitle>Add New Profile</DialogTitle>
      <DialogContent>
        <form>
          <TextField label="Name" fullWidth marginTop="8"/>
          <TextField label="Position" fullWidth />
          <TextField label="Past Projects" fullWidth />
          <TextField label="Years of Expertise" fullWidth />
          <TextField label="Technical Skills" fullWidth />
          
        </form>
      </DialogContent>
      <DialogActions>
        <Button onClick={handleClose}>Cancel</Button>
        <Button onClick={handleClose} variant="contained" color="primary">Save</Button>
      </DialogActions>
    </Dialog>
  );
}

export default NewProfileForm;
